import React from 'react';
import { ImageBackground,StyleSheet } from 'react-native';


function App(){
  return(
    <ImageBackground style={styles.background} source={require("./assets/maxresdefault.jpg")}>
    </ImageBackground>
  );
}
const styles = StyleSheet.create({
  background:{
    flex:1,
  }
})

export default App;
